import React from 'react'
import './login.css'
import { Col, Container, Row } from 'react-bootstrap';

const Login = () => {
  return (
    <Container style={{height:"10%"}}>
      <Row>
        <Col>
          {/* Content for the first column */}
        </Col>
        <Col>
          {/* Content for the second column */}
        </Col>
      </Row>
    </Container>
  );
};

export default Login;
